import React from 'react'

const Help2 = () => {
  
  let demo = (a)=>{
    a.preventDefault();
  }
  let demo1 = ()=>{
    console.log("**********");
  }
  return (
    <>
        <div className='container' style={{minHeight : "650px"}}>
            <button onClick={(event)=>demo(event)} className='btn btn-info'>OK</button>
            <br />
            <br />
            <input type='text' onKeyDown={demo1}/>
        </div>
    </>
  )
}

export default Help2
